import React, { useState } from 'react';
import 'react-calendar/dist/Calendar.css';



export default function Booking({active, setActive}, props) {
    const link = props


    return (
        <div className={active ? "modal active" : "modal"} onClick={() => setActive(false)}>
            <div className='booking-block flex' onClick={e => e.stopPropagation()}>
                <div className="booking-top flex">
                    <h2 className="booking-title">Записаться на прием</h2>
                    <div className="close-block flex" onClick={() => setActive(false)}>
                        <span className="close-booking"></span>
                    </div>  
                </div>


                <iframe className="yclient"  scrolling="yes" frameBorder="0" allowtransparency="true" id="ms_booking_iframe" src={link.getLink = None ? "https://n1076145.yclients.com" : link.getLink}></iframe>  
            </div>
        </div>
  )     
}
